import React, { Component } from 'react'
import { Card, Col, Row } from 'react-bootstrap'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom';
import { getUsersList } from '../../actions/userAction'
import HomeCp from '../../component/homeCp/HomeCp';

class home extends Component {


    componentDidMount() {
        this.props.dispatch(getUsersList());
    }

    render() {  

        return (
            <div>
                <h1> array </h1>
                <Row>
                    <HomeCp/>
                {getUsersList.length === 0?"data tidak ada":
                            getUsersList && getUsersList.map((menu) => (
                                <Link to={'/detail/' + menu.id}>
                    <Col md={4} xs={6} className="mb-4 mt-4 ml-4">
                        <Card style={{ width: '18rem' }} className="shadow">
                            <Card.Img variant="top" src={"assets/images/nama/" + menu.gambar} />
                            <Card.Body>
                                <Card.Title>{menu.getUsersList.name} </Card.Title>
                                <Card.Text>
                                    {menu.getUsersList.username}
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    </Col>
                </Link>
                            )
                            )}
                </Row>
            </div>
        )
    }
}

export default connect()(home);
